import React from "react";
import 'bootstrap/dist/css/bootstrap.css';

const WorkoutButton = () => {
    const handleClick = () => {
        console.log('Button clicked');
    };

    return (
        <button type="button" onClick={handleClick}>Create workout</button>
    );
    
};


export default WorkoutButton;
